<template lang="pug">
.card.h-100
  .card-body
    .row
      .col-md-3
        img.img-fluid.rounded-start(:src="'data:image/jpeg;base64,' + projectData.mthumb")
      .col-md-9
        .card-body
          .card-title Manager: {{ projectData.manager }}
          .center(v-html="projectData.mdescription")
          u.card-title Project Details
          .center(v-html="projectData.description")
    div.row(v-if="unit.state =='RUN'")
      table
        td
          th CPUs Assigned
          tr {{ unit.cpus }}
        td
          th Credit
          tr {{ unit.assignment.credit }}
        td
          th Project
          tr {{ unit.assignment.project }}
        td
          th State
          tr {{ unit.state }}
        td
          th Progress
          tr {{ (unit.progress*100).toFixed() + '%' || 0 }}
</template>

<script>
import { reactive, computed, watch } from "vue";

import useWebSocket from "../composables/useWebSocket";
import useAPI from "../composables/useAPI"

export default {
  name: "Details",
  props: {
    unitId : {
      default: 0,
      type: Number
    }
  },
  setup(props) {
    const { units } = useWebSocket
    const { getProjectData } = useAPI

    const data = reactive({
      project: {}
    });

    const unit = computed(() => units.value[props.unitId])

    watch(() => props.unitId, () => {
      if(units.value[props.unitId].assignment.hasOwnProperty('project'))
        data.project = getProjectData(units.value[props.unitId].assignment.project);
    });

    const projectData = {"manager":"Prof. Vincent Voelz","cause":"cancer","description":"<p>This project simulates the folding dynamics of several cyclic and non-cyclic peptides with designed halogen bond donors and acceptors.&nbsp;We are particularly interested in comparing simulation results to experimental data across many different sequences, to assess the viability of simulation-based computational protein design.&nbsp; This is a collabation with the Mate Erdelyi&nbsp;group at Uppsala University.</p>\n","thumb":"","url":"","institution":"Temple University","mthumb":"","mdescription":"<p>Dr. Voelz&#39;s research focuses on using new simulation methods to understand and&nbsp;design molecular function, by&nbsp;modeling the folding and binding properties of proteins, peptides, and peptidomimetics. The <a href=\"http://www.voelzlab.org\">Voelz Lab</a> participates in the Folding@home project, hosting eight servers at Temple University.&nbsp;</p>\n","modified":"2021-05-21 19:58:54","projects":"16976-16978"}

    return { data, projectData, unit };
  }
}
</script>

